import React from 'react';
import logo from '../assets/img/WorldOnpencil.png';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faSearch } from '@fortawesome/free-solid-svg-icons';
import "./Header.css";
import us from '../assets/img/countries/2560px-Flag_of_the_United_States.svg.png'
import ind from '../assets/img/countries/1350px-Flag_of_India.svg.png'

function Header() {
    return <div className='header navbar-dark'>
        {/* // header logo */}
        <div>
            <a className='navbar-brand header__logo' href='#'>
                {/* <img src={logo} className='header_logo'/> */}
                World On Pencil
            </a>
        </div>
        {/* // header search */}
        <div className='header_search'>
            <select name="" id="header_cat" value={"All"} placeholder='all'>
                <option value="all">all</option>
                <option value="all">cat 1</option>
                <option value="all">cat 2</option>
                <option value="all">cat 3</option>
                <option value="all">cat 4</option>

            </select>
            <input type="text" name="search" className='search_input' id="" />
            <button className='header__searchIcon'><FontAwesomeIcon icon={faSearch}></FontAwesomeIcon></button>
        </div>

        {/* // options like  */}
        <div className='Language'>
            <div>
                <span className='flag'>
                    <img src={ind} alt="" srcset="" style={{ maxWidth: "100 %", maxHeight: "100%" }} />
                </span>
                <span className='bottomText'>

                </span>
            </div>

        </div>
        {/* // sign in */}
        {/* // cart */}
    </div>
}

export default Header;
